import React from 'react';
import { Box, Heading, Flex, Image } from '@chakra-ui/react';

const PastSponsors = () => {
  return (
    <Box id="past-sponsors" py={12} px={8}>
      <Heading mb={8}>Past Sponsors</Heading>
      <Flex justify="space-around">
        <Box textAlign="center">
          <Image src="https://via.placeholder.com/150x100" alt="Sponsor 1 Logo" mb={4} />
          <Heading fontSize="xl">Sponsor 1</Heading>
        </Box>
        <Box textAlign="center">
          <Image src="https://via.placeholder.com/150x100" alt="Sponsor 2 Logo" mb={4} />
          <Heading fontSize="xl">Sponsor 2</Heading>
        </Box>
        <Box textAlign="center">
          <Image src="https://via.placeholder.com/150x100" alt="Sponsor 3 Logo" mb={4} />
          <Heading fontSize="xl">Sponsor 3</Heading>
        </Box>
      </Flex>
    </Box>
  );
};

export default PastSponsors;
